  false,\n\t\"url\": null,\n\t\"notes\": \"The Emergency Wetlands Resources Act of
  1986 authorizes the Fish and Wildlife Service to collect entrance fees within selected
  units of the National Wildlife Refuge System. The purpose of this legislation is
  to provide additional revenues for the conservation of wetland resources of the
  nation and for the operation and maintenance of existing refuges. Crab Orchard National
  Wildlife Refuge meets the criteria set forth in the act for implementation of such
  an entrance permit system. This document outlines the details for implemenmtation
  of such a system for this refuge\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
